///<reference path="plotlyjs.d.ts"/>
import {AppMenuHandler} from "../AppMenuHandler"
import {Plot2D} from "../model/Plot2D";
import {SubscriptionClient} from "../protocol/SubscriptionClient";
import * as Collections from 'typescript-collections';
import {ModelStructure} from "../protocol/ModelStructure";
import {BrowserController} from "../plotBrowser/BrowserController";

export class PlotController {
    private _plots = new Collections.Dictionary<string, Plot2D>();
    private _menuHandler: AppMenuHandler;
    private _subClient: SubscriptionClient;
    private _browserCtrl: BrowserController;
    private _form: W2UI.W2Form;

    constructor(menuHandler: AppMenuHandler, subClient: SubscriptionClient, browserCtrl: BrowserController) {
        this._menuHandler = menuHandler;
        this._subClient = subClient;
        this._browserCtrl = browserCtrl;
    }

    async add2DPlotDidMount() {
        if(this._form != null) {
            w2ui["add2DPlot"].render($('#addPlot2D')[0]);
            return;
        }

        let self = this;
        let model : ModelStructure = await this._subClient.getModelInfo();
        let vars = model.getAllVariables();

        this._form = $('#addPlot2D').w2form({
            name: "add2DPlot",
            header: 'Add 2D Plot',
            fields: [
                { name: 'field_text', type: 'text', required: true },
                { name: 'field_list', type: 'list', required: true,
                    options: { items: vars } }
            ],
            actions: {
                reset: function () {
                    this.clear();
                },
                save: function () {
                    var title = this.record["field_text"];
                    var variableName = this.record["field_list"].text;
                    self.create2DPlot(title,variableName);
                    this.clear();
                }
            }
        });
    }

    create2DPlot(title: string, variable: string) {
        // Create plot and add to plot map
        let plot = new Plot2D();
        plot.title = title;
        this._plots.setValue(title, plot);

        // Subscribe to variable
        this._subClient.subscribe(variable, (data) => {
            plot.addPoint(+data.value);
            plot.changed = this.update2DPlot.bind(this);
        });

        // Add to browser
        this._browserCtrl.addPlot("2D", title);
    }

    show2DPlotByTitle(title: string) {
        let plot : Plot2D = this._plots.getValue(title);
        if(plot == null)
            return;

        // Set shown false for each plot
        this._plots.forEach((k : string, v : Plot2D) => v.shown=false);

        // Retrieve trace
        let trace = {x: plot.data.x, y: plot.data.y, type: plot.data.type, name: plot.title};

        // Setup layout and plot
        var layout : any = {
            title: plot.title,
            showlegend: true,
            autosize: true,
            width: 600,
            height: 600,
            scene: {
                xaxis: {title: 'Time'},
                yaxis: {title: 'Value'}
            }
        };
        Plotly.newPlot('plot', [trace], layout, {showLink: false});
        plot.shown = true;
    }

    update2DPlot(title: string) {
        let plot : Plot2D = this._plots.getValue(title);
        if(plot == null || <HTMLDivElement>document.querySelector("#plot") == undefined)
            return;

        let trace = {x: [plot.data.x], y: [plot.data.y]};

        Plotly.restyle('plot', trace, 0);
    }

    show3DPlotById(id: number) {
        var layout : any = {
            title: 'Congestion',
            showlegend: false,
            autosize: true,
            width: 600,
            height: 600,
            scene: {
                xaxis: {title: 'Edge #'},
                yaxis: {title: 'Time'},
                zaxis: {title: 'Value'}
            }
        };
        Plotly.newPlot('plot', [trace6, trace7, trace8], layout, {showLink: false});
    }

    initialize() {
    }
    
    addPoint(x : number, y: number) {
        var length = trace8.y.length;
        var newX : number[] = trace8.x[length-1];
        var newY : number[] = [trace8.y[length-1][0] + x, trace8.y[length-1][0] + x];
        var newZ : number[] = [trace8.z[length-1][0] + y*0.005, trace8.z[length-1][0] + y*0.005];
        var update : Object = {
            x: [trace8.x.concat([newX])],
            y: [trace8.y.concat([newY])],
            z: [trace8.z.concat([newZ])]
        }
        Plotly.restyle('plot', update, [2]); // Name of div, updated trace, and index of trace
        console.log("Restyled plot");
    }
}


